      };
      this.user = props.user;
    }

    render(){
        return(
            <div>
                <div className="d-flex mb-1">
                        <img className="rounded-circle" src={this.user.img} height="50" width="50"></img>
                        <div className="ml-2">
                            <p className="m-0"><b>{this.user.user.first_name} {this.user.user.last_name}</b></p>
                            <NavLink style={{color:'#5b7083'}}  to={"/user/"+this.user.user.username}><p className="m-0">@{this.user.user.username}</p></NavLink>
                        </div>
                    </div>
            </div>
        )
    }
}

export default UserItem
